import "./App.css";

let name = "Koyal";
function App() {
  return (
    <>
      <nav>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </nav>
      <div className="container">
        <h1>Hello {name}</h1>
        <p>
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Cumque et
          eveniet ut perspiciatis consequatur facere quasi hic necessitatibus,
          sint pariatur! Ipsum autem magnam eos.
        </p>
      </div>
    </>
  );
}

export default App;
